import { makeStyles } from '@material-ui/core/styles';

export const useStyles = makeStyles((theme) => ({
  div: {
    paddingTop: 20,
    marginLeft: 25,
    marginBottom: -15,
    backgroundColor: '#4D94C8',
    margin: '0rem -5rem 0rem -5rem'
  },
  logoBox: {
    marginTop: '4%'
  }
}));
